import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import Settingspage from "./Settings";
import EditPage from "../EdiitPage/EditPage";
import SavedmessagePage from "../../SavedMessagePage/SavedMessagePage";

const Stack = createStackNavigator();

const Navigation = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Setting">
        <Stack.Screen name="Setting" component={Settingspage} />
        <Stack.Screen name="Edit Page" component={EditPage} />
        <Stack.Screen name="Savedmessage Page" component={SavedmessagePage} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default Navigation;
